import React,{useState} from 'react';
import AddUser from './components/Users/AddUser';

function App() {
  const [userList,addUserList] = useState('');
  const getUser = (user)=>{

    addUserList(prevState=>{
      return[user,...prevState];
    });
    console.log(userList);
  }
  return (
   <AddUser updateUser={getUser}/>
  );
}

export default App;
